// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract DeFiLoan {
    AggregatorV3Interface internal priceFeed;
    mapping(address => uint256) public collateral;
    mapping(address => uint256) public borrowed;
    uint256 public constant COLLATERAL_RATIO = 150;
    uint256 public constant LIQUIDATION_THRESHOLD = 120;

    constructor(address _priceFeed) {
        priceFeed = AggregatorV3Interface(_priceFeed);
    }

    function depositCollateral() external payable {
        require(msg.value > 0, "Collateral must be greater than 0");
        collateral[msg.sender] += msg.value;
    }

    function borrow(uint256 amount) external {
        require(amount > 0, "Borrow amount must be greater than 0");
        uint256 ethPrice = getEthPrice();
        uint256 maxBorrow = (collateral[msg.sender] * ethPrice * 100) / (COLLATERAL_RATIO * 1e8);
        require(borrowed[msg.sender] + amount <= maxBorrow, "Exceeds max borrowable amount");
        borrowed[msg.sender] += amount;
    }

    function repay(uint256 amount) external {
        require(amount <= borrowed[msg.sender], "Repay amount exceeds debt");
        borrowed[msg.sender] -= amount;
    }

    function liquidate(address user) external {
        uint256 ethPrice = getEthPrice();
        uint256 collateralValue = (collateral[user] * ethPrice) / 1e8;
        uint256 ratio = (collateralValue * 100) / (borrowed[user] == 0 ? 1 : borrowed[user]);
        require(ratio < LIQUIDATION_THRESHOLD, "User is not undercollateralized");
        collateral[user] = 0;
        borrowed[user] = 0;
    }

    function getEthPrice() public view returns (uint256) {
        (, int price,,,) = priceFeed.latestRoundData();
        return uint256(price);
    }

    function getUserStatus(address user) public view returns (uint256, uint256, uint256) {
        uint256 ethPrice = getEthPrice();
        uint256 collateralValue = (collateral[user] * ethPrice) / 1e8;
        return (collateral[user], borrowed[user], collateralValue);
    }
}

